import logo from './logo.svg';
import './App.css';
import {Routes, Route} from "react-router-dom";
import MainPage from "./MainPage";
import SubPage from "./SubPage";

function App() {
  return (
    <div>

      <Routes>
        <Route path ={"/"} element={<MainPage/>}/>
        <Route path={"/sub"} element = {<SubPage/>}/>
      </Routes>
    </div>
  );
}

export default App;
